#include <cstdio>
#include <cstdlib>
#include <cstring>
#include <cmath>

int main()
{
	int i,j;
	double L,d,C,L2,R,delta,theta,x;

	while (scanf("%lf %lf %lf ", &L, &d, &C)==3) {
	  if (L < 0) break;
 		if (L < 1e-6 || d < 1e-6 || C < 1e-6) {
 			printf("0.000\n");
 			continue;
 		}
		L2 = d*C*L + L;
		L2/=2.0; L/=2.0;
		for (x = 1e20, delta=1e20; delta>=1e-12; delta/=2.0) {
			R = sqrt(x*x + L*L);
			if (fabs(x) < 1e-10) x = 1e-10;
			theta = atan(L/x);
			if (theta*R < L2) x-=delta;else x+=delta;
		}
		R = sqrt(x*x + L*L);
		printf("%.3lf\n", R-x);
	}
	return 0;
}

// three powers problem
// took me about 20 min, but I was struggling with java.
// I could see somebody doing it <10 min.
import java.math.*;
import java.io.*;
import java.util.*;

class Main {
    public static void main(String[] args) {
        BufferedReader in = new BufferedReader(
				new InputStreamReader(System.in));
        String line;
	StringTokenizer st;
	BigInteger a,b,n,r;
	BigInteger two,three;
	int p,first;

	two = new BigInteger("2");
	three = new BigInteger("3");
	try {
	    while(true) {
                line = in.readLine();
                if(line == null) break;
		st = new StringTokenizer(line);
		n = new BigInteger(st.nextToken());
		if (n.intValue() == 0) break;
		n = n.subtract(BigInteger.valueOf(1));
		System.out.print("{");

		for (p=0, first=1; n.signum()>0; p++) {
			r = n.mod(two);
			if (r.intValue() == 1) {
				if (first==0) System.out.print(", ");
				else System.out.print(" ");
				first = 0;
				System.out.print(three.pow(p));
			}
			n = n.divide(BigInteger.valueOf(2));		
		}
		System.out.println(" }");
	    }
	} catch(Exception e) {
            System.err.println(e.toString());
	}
    }
}

#include <cstdio>
#include <cstdlib>
#include <string>
#include <utility>
#include <vector>
#include <set>
using namespace std;
int main()
{
	int cnum,nc,i,n,N,M,L,cost;
	char name[105][32];
	int A[105],B[105];

	scanf("%d ", &nc);
	for (cnum=1; cnum<=nc; cnum++) {
		set<pair<int,string> >::iterator ii;
		set<pair<int,string> > ss;
		printf("Case %d\n", cnum);
		scanf("%d %d %d ", &N, &M, &L);
		for (i=0; i<L; i++) {
			scanf("%[^:]: %d, %d ", name[i], &A[i], &B[i]);
			n = N;
			cost = 0;
			while(n/2>=M && B[i]<=(n-n/2)*A[i]) {
				n /= 2;
				cost += B[i];
			}
			cost += (n-M)*A[i];
			string sss = name[i];
			ss.insert(make_pair(cost,sss));
		}
		for (ii=ss.begin(); ii!=ss.end(); ii++) 
			printf("%s %d\n", (ii->second).c_str(), ii->first);
	}
	return 0;
}

#include <stdio.h>
#include <assert.h>
#include <math.h>
#include <map>
#include <limits.h>
#include <float.h>

using namespace std;

#define MAXN 10+1

int main () {
  int t;
  scanf("%d",&t);
  for(int sc = 1; sc <=t; sc++) {
    printf("Scenario %d:\n",sc);
    int n, v[MAXN], h[MAXN];
    scanf("%d",&n);
    assert(1<=n && n<=MAXN);
    int gs;
    scanf("%d\n",&gs);
    for(int i=1;i<=n;i++) { scanf("%d",&h[i]); assert(1<=h[i]&&h[i]<=50); }
    for(int i=1;i<=n;i++) { scanf("%d",&v[i]); assert(1<=v[i]&&v[i]<=50); }
    int xs,ys,xt,yt,te,tl;
    scanf("%d%d%d%d%d%d",&xs,&ys,&xt,&yt,&te,&tl);
    assert(tl <= 1000);
    int dx = 0, dy = 0;
    map<int,double> m[MAXN][MAXN];
    pair<int,double> p;
    if (tl < te) goto B;
    if (xs<xt) dx = 1; if (xs>xt) dx = -1;
    if (ys<yt) dy = 1; if (ys>yt) dy = -1;
    m[xs][ys][0] = 0.0;
    for(int i=xs;;i+=dx) {
      if (dx > 0 && i>xt) break;
      if (dx < 0 && i<xt) break;
      for(int j=ys;;j+=dy) {
	//	printf("%d %d, qsize = %d \n",i,j, m[i][j].size());
	if (dy > 0 && j>yt) break;
	if (dy < 0 && j<yt) break;
	if (i==xt && j==yt) goto A;
	if (i!=xt) {
	  map<int,double> :: iterator pos;
	  for(pos=m[i][j].begin();pos!=m[i][j].end();pos++) {
	    for(int s=5;s<=h[j];s+=5) {
	      int t = (*pos).first+3600*gs/s;
	      if ( t > 60*tl) continue;
	      if (m[i+dx][j].find(t) == m[i+dx][j].end() ||
		  m[i+dx][j][t] > (*pos).second+gs/(80-0.03*s*s))
		m[i+dx][j][t] = (*pos).second+gs/(80-0.03*s*s);
	    }
	  }
	}
	if (j!=yt) {
	  map<int,double> :: iterator pos;
	  for(pos=m[i][j].begin();pos!=m[i][j].end();pos++) {
	    for(int s=5;s<=v[i];s+=5) {
	      int t = (*pos).first+3600*gs/s;
	      if (t > 60*tl) continue;
	      if (m[i][j+dy].find(t) == m[i][j+dy].end() ||
		  m[i][j+dy][t] > (*pos).second+gs/(80-0.03*s*s))
		m[i][j+dy][t] = (*pos).second+gs/(80-0.03*s*s);
	    }
	  }
	}
	if (!dy) break;
      }
      if (!dx) break;
    }
  A: if (m[xt][yt].empty()) goto B;
  else {
    p = *(m[xt][yt].begin());
    assert(p.first <= tl*60);
    double bt=INT_MAX,btf, bf=DBL_MAX, bft;
    map<int,double>:: iterator pos;
    for(pos=m[xt][yt].begin();pos!=m[xt][yt].end();pos++) {
      p = *pos;
      assert(p.first <= tl*60);
      if (p.first < 60*te || p.first > 60*tl) continue;
      if (p.second < bf) { bf = p.second; bft = p.first; }
      else if (p.second == bf && p.first < bft) bft = p.first;
      if (p.first < bt) { bt = p.first; btf = p.second; }
      else if (p.first == bt && p.second < btf) btf = p.second;
    }
    if (bt == -1) goto B;
    printf("The earliest  arrival: %.0f minutes, fuel %.2f gallons\n",
	   ceil(bt/60), btf);
    printf("The economical travel: %.0f minutes, fuel %.2f gallons\n",
	   ceil(bft/60), bf);
    continue;
  }
  B: printf("IMPOSSIBLE\n"); 
  }
}

// Leaf prunning.

// Each leaf keeps information about the subtree that was reduced
// to the leaf during the course of the algorithm, it is the number
// of surplus marbles in the subtree, when negative it is the number of missing
// marbles in the subtree.

// Initially, each vertex has the value m equal the number of original marbles
// at it.

// Let set L be the set of leaves of the tree.
// tcost = 0
// while card(L) > 1
//   pick a member of L, name it v
//   switch m[v] of
//   case m[v] < 0
//     tcost += -m[v]           // all have to walk this step from the parent
//     m[parent[v]] += m[v]
//   case m[v] = 0
//     tcost++                  // 1 has to walk from the parent
//     m[parent[v]--   
//   else
//     tcost += m[v]-1          // 1 has to stay the rest has to walk 
//                              // to the parent
//     m[parent[v]] += m[v]-1
//   

// P. Rudnicki, Edmonton, April 8th 

#include <stdio.h>
#include <set>

using namespace std;
#define MAXN 10000

int m[MAXN], parent[MAXN];
set<int> children[MAXN];
set<int> leaves, nleaves;
int main () {
  int n, tcost;
  while (scanf("%d",&n) == 1) {
    if (!n) break;
    leaves.clear();
    tcost = 0;
    for(int i = 1; i <= n; i++) {
      int v, d;
      scanf("%d",&v);
      scanf("%d%d",&m[v],&d);
      for(int j = 1; j <= d; j++) {
	int c;
	scanf("%d",&c);
	children[v].insert(c);
	parent[c] = v;
      }
      if (!d) leaves.insert(v);
    }
    set<int>:: iterator pos;
    while (leaves.size() != 1) {
      nleaves.clear();
      for(pos = leaves.begin(); pos != leaves.end(); pos++) {
	if (m[*pos] <= 0) {
	  tcost += -m[*pos]+1;
	  m[parent[*pos]] += m[*pos]-1;
	} else {
	  tcost += m[*pos]-1;
	  m[parent[*pos]] += m[*pos]-1;
	}
	children[parent[*pos]].erase(*pos);
	if (children[parent[*pos]].empty()) 
	  nleaves.insert(parent[*pos]);
      }
      leaves = nleaves;
    }
    printf("%d\n",tcost);
  }
}
